    margin:20px 0px;
`
const SocialContainer = styled.div`
    display:flex;
`;
const SocialIcon = styled.div`
    width:40px;
    height:40px;
    border-radius:50%;
    color:white;
    background-color: #${props=>props.color};
    display:flex;
    justify-content:center;
    align-items:center;
    margin:10px;
`





const Center = styled.div`
    flex:1;
    padding:20px;
`

const Title = styled.h3`
    h12
`
const Right = styled.div`
    flex:1;
    padding:20px;
    

`

